import React from 'react'

import './notes.css'

export default function Notes() {
  return (
    <div className='notes'>
        <input type="text" placeholder='Title' />
        <textarea name="" id="" cols="30" rows="10"></textarea>
        <p>{new Date()}</p>
    </div>
  )
}
